import React from 'react';
import { Link } from 'react-router-dom'
import { Button } from '@chakra-ui/core'
import customTheme from '../../theme';

function Home() {
  return (
    <Link to="/">
      <Button bg={customTheme.themeColors[500]}>Button</Button>
    </Link>
  );
}

export default Home;
